import "../CSS/App.css";
import {
    AdvancedChart,
    TickerTape,
    SymbolOverview,
} from "react-tradingview-embed";
import tempPhoto from "../PICTURES/headShot.png";
import { useState } from "react";
function App() {
    const [publicKey, setPublicKey] = useState("");
    const [privateKey, setPrivateKey] = useState("");
    const [detailsData, setDetailsData] = useState({});
    const [positionsData, setPositionData] = useState({});
    const ENDPOINT = "https://paper-api.alpaca.markets";

    console.log(publicKey, privateKey);
    const getDetails = async (e) => {
        var myHeaders = new Headers();
        myHeaders.append("APCA-API-KEY-ID", "PKIYIEQRI513Q1KOLVPJ");
        myHeaders.append(
            "APCA-API-SECRET-KEY",
            "oHkiE0bo3qy5QuoLo1QbLlcJmnN3g9u1vqNU6OS4"
        );

        var requestOptions = {
            method: "GET",
            headers: myHeaders,
            redirect: "follow",
        };

        await fetch(
            "https://paper-api.alpaca.markets/v2/account",
            requestOptions
        )
            .then((response) => response.json())
            .then((result) => {
                setDetailsData(result);
                console.log("here", detailsData);
            })
            .catch((error) => console.log("error", error));

        var myHeaders = new Headers();
        myHeaders.append("APCA-API-KEY-ID", "PKIYIEQRI513Q1KOLVPJ");
        myHeaders.append(
            "APCA-API-SECRET-KEY",
            "oHkiE0bo3qy5QuoLo1QbLlcJmnN3g9u1vqNU6OS4"
        );

        var requestOptions = {
            method: "GET",
            headers: myHeaders,
            redirect: "follow",
        };

        await fetch(
            "https://paper-api.alpaca.markets/v2/positions",
            requestOptions
        )
            .then((response) => response.json())
            .then((result) => {
                setPositionData([
                    {
                        symbol: "AAPL",
                        asset_class: "us_equity",
                        avg_entry_price: "210.0",
                        qty: "5",
                        side: "long",
                        market_value: "600.0",
                        unrealized_pl: "100.0",
                        unrealized_intraday_pl: "10.0",
                        current_price: "120.0",
                    },
                    {
                        symbol: "F",
                        asset_class: "us_equity",
                        avg_entry_price: "24.0",
                        qty: "5",
                        side: "long",
                        market_value: "600.0",
                        unrealized_pl: "100.0",
                        unrealized_intraday_pl: "10.0",
                        current_price: "120.0",
                    },
                    {
                        symbol: "GME",
                        asset_class: "us_equity",
                        avg_entry_price: "434.0",
                        qty: "5",
                        side: "long",
                        market_value: "600.0",
                        unrealized_pl: "100.0",
                        unrealized_intraday_pl: "10.0",
                        current_price: "120.0",
                    },
                    {
                        symbol: "GME",
                        asset_class: "us_equity",
                        avg_entry_price: "434.0",
                        qty: "5",
                        side: "long",
                        market_value: "600.0",
                        unrealized_pl: "100.0",
                        unrealized_intraday_pl: "10.0",
                        current_price: "120.0",
                    },
                ]);
                console.log("here", positionsData);
            })
            .catch((error) => console.log("error", error));
    };
    // console.log(detailsData);
    return (
        <div className="Home">
            <div className="tape">
                <TickerTape
                    widgetProps={{
                        symbols: [
                            {
                                description: "Tesla",
                                proName: "NASDAQ:TSLA",
                            },
                            {
                                description: "Apple",
                                proName: "NASDAQ:AAPL",
                            },
                            {
                                description: "Amazon",
                                proName: "NASDAQ:AMZN",
                            },
                            {
                                description: "Nvidia",
                                proName: "NASDAQ:NVDA",
                            },
                            {
                                description: "Microsoft",
                                proName: "NASDAQ:MSFT",
                            },
                            {
                                description: "GameStop",
                                proName: "NYSE:GME",
                            },
                            {
                                description: "Netflix",
                                proName: "NASDAQ:NFLX",
                            },
                            {
                                description: "Coinbase",
                                proName: "NASDAQ:COIN",
                            },
                            {
                                description: "Google",
                                proName: "NASDAQ:GOOGL",
                            },
                            {
                                description: "Twitter",
                                proName: "NYSE:TWTR",
                            },
                            {
                                description: "PayPal",
                                proName: "NASDAQ:PYPL",
                            },
                            {
                                description: "Boeing",
                                proName: "NYSE:BA",
                            },
                            {
                                description: "Disney",
                                proName: "NYSE:DIS",
                            },
                            {
                                description: "Home Depot",
                                proName: "NYSE:HD",
                            },
                            {
                                description: "Ford",
                                proName: "NYSE:F",
